import styled from "styled-components";
import { Link } from 'react-router-dom';
import '../App.css';
import {TextField, Button} from'@mui/material';

const Main = styled.div`
  background: blueviolet;
`

const MainWindow = styled.div`
  width: 500px;
  margin: 0 auto;
  margin-top: 180px;
  background-color: #fa8;
  hr{
    margin: 0 auto;
    width: 95%;
    border: none;
    border-top: 1px solid grey;
  }
`

const SwitchSignIn = styled.div`
  width: 100%;
  height: 60px;
  display: flex;
  align-items: center;
  
  a{
    text-decoration: none;
    color: #787d85;
    text-transform: uppercase;
    letter-spacing: 1px;
    font-size: 11px;
    font-weight: 600;
    margin-left: 40px;
    :hover{
      color: black;
      transition: 1500ms;
    }
  }
`


const MainContainer = styled.div`
  width: 84%;
  margin: 0 auto;
  #headline{
    margin: 30px 0 20px 0px;
    font-size: 24px;
    font-weight: normal;
    color: black;
  }
  .MuiInputBase-root{
    margin-bottom: 20px;
  }
  #outlined-basic{
    width: 350px;
  }
`


const SignIn = () => {
  return (
    <Main>
      <p>Ссылка сработала, заебись</p>
      <Link to='/Dashboard'>Домой</Link>
      <MainWindow> 
        <SwitchSignIn>
          <a href="#">Войти</a>
          <a href="#">Создать учётную запись</a>
        </SwitchSignIn>
        <hr/>
        <MainContainer>
          <p id="headline">Войти с помощью вашей учётной записи</p>
          <TextField
            id="outlined-basic"
            color="warning"
            size="small"
            label="Адрес электронной почты" 
            variant="outlined" />
          <TextField id="outlined-basic"
            color="warning"
            size="small" 
            label="Пароль" 
            variant="outlined" 
            type="password" />
          <Button variant="contained">Войти</Button>

        </MainContainer>
      </MainWindow>
    </Main>
  );
}

export default SignIn;
